B.KO=new A.aQ("Food insecurity is a pervasive problem in the United States, with 1 in 8 Americans affected. Food banks are often the first line of defense for those facing food insecurity, but they frequently struggle with food collection and distribution. This is compounded by the fact that many individuals do not qualify for federal nutrition programs and therefore rely heavily on local food banks. All the while, in a country where 30-40% of food goes to waste, much of it is discarded simply because it is deemed \"ugly\" or past its sell-by date. Such items are often safe to donate but are overlooked.\n\nTo tackle these problems, a group of college students and I developed the Community Food app, which works with restaurants, grocers, and food banks to connect people to better food. The app makes it easy to list donations and schedule food pickups in just a few taps. We identified three main reasons why restaurants and grocers often don't donate food: lack of education, hassle/lack of time, and an assumption that the food is unwanted. However, our research revealed that nobody said they don't donate because they have nothing to give or no one to give it to; they simply didn't know what to give or who would be the best recipient.\n\nWe realized that the problem wasn't a supply problem, but a data problem. So we set out to automate the food donation and collection process while also educating the public. This was the founding idea for the Community Food app. The current donation process is cumbersome, requiring individuals to search for their local food bank, call to describe their possible donation, and wait for an overworked volunteer to respond. Poor descriptions can lead to wasted time and food.",null,B.q,null)
B.C9=A.a(s([B.KO]),t.n)
B.K5=new A.aQ("The Community Food app streamlines the process. Donors can download the app, register their location, and scan barcodes of items ready to be sent to food services, along with a brief description. Volunteers at local food services are then alerted on their phones that there is food ready to be retrieved. They receive information on the type of food, its nutritional content, its size, and its perishability. This helps volunteers make educated decisions on how much room they need, how many volunteers should go out, and whether they need to bring a refrigeration unit. The app saves time, prevents food spoilage, and ensures that everyone involved has the information they need.\n\nThe Community Food app takes advantage of the fact that most people have a smartphone with access to the internet, GPS, and a camera. We turn the average smartphone into a network of data collection devices in the fight against hunger. The app removes the need to know who and where one is donating to, eliminates logging and communication hassles, and most importantly, shares exact nutrients and sizing information with the volunteers picking up the food.\n\nFood insecurity and food waste are two significant issues that we aimed to solve with one elegant solution. Education and automation of the food donation and receiving process are critical steps in tackling these issues head-on. The Community Food app is a powerful tool that can help solve the problems for both food waste and food insecurity, making it easier for people to donate and receive food, and ensuring that more food goes to those who need it most.",null,B.q,null)
B.BY=A.a(s([B.K5]),t.n)
B.Cc=A.a(s(["Food Donation","communityfood.png","comfood2.png","comfood3.png","Community Food",B.C9,B.BY,"Scanning a barcode in the app","Securely signing into the system","See it on the Play Store","https://play.google.com/store/apps/details?id=com.certainlyapps.community_food",4294220075,"Food insecurity affects 1 in 8 Americans, while 30-40% of food in the US goes to waste. However, a group of college students has developed an innovative solution to tackle these issues with their Community Food app, which automates the food donation and collection process, while also educating donors and volunteers on the best practices of food donation."]),t.b)
B.Kr=new A.aQ("When I was a student at Rochester Institute of Technology, I stumbled upon a small building tucked away at the back of the campus. This beige paneled building was mostly occupied by a laundry room, but adjacent to it was something unique \u2013 the FoodShare. It was a resourceful place for students in need, where they could pick up donated groceries and other essential items donated by the local community. However, it was not until a friend mentioned that the FoodShare had over 8,000 student visits in two years that I realized how food scarcity affected many of my fellow students.\n\nA semester later I started Campus Food. It started as a Twitter retweet bot to search for tweets mentioning free food at RIT and retweet them to the @RITFreeFood account for my followers. I thought of this as a fun way to learn Python and help students find free food. I soon realized that this idea had potential as I received over 500 followers and many missed messages. This inspired me to create an RITFreeFood website where students could view a live map of free food powered by location keywords in tweets. I also added a feature for students to submit new events directly to the service. Soon after, brands began reaching out to me, wanting to promote their products.\n\nI decided to take this idea to the next level and created a mobile application, now known as Campus Food, which would enable better scaling and reach more students. I released the app on both iOS and Android, and it quickly gained minor popularity on campus. My goal was to implement ads and collaborate with brands to promote their giveaways and start making revenue. I recruited a small team of students to help me grow this idea.",null,B.q,null)
B.CY=A.a(s([B.Kr]),t.n)
B.Ko=new A.aQ("The following semester, we launched a crowdfunding campaign to scale our app to new campuses. Today, Campus Food is functional on over 800 campuses in the United States, helping hungry students find free food and reducing food waste. Our mission is to ensure that no student goes hungry, and we are proud to have made a difference in the lives of many students across the country.\n\nSometimes the most simple ideas can reach a large audience. I didn\u2019t expect my initiative to learn Python and locate pizza would lead me to create an app that could impact so many students' stomachs. I am grateful to have received so much positive feedback so far, and I hope that Campus Food continues to make a positive difference for years to come.",null,B.q,null)
B.Dl=A.a(s([B.Ko]),t.n)
B.D7=A.a(s(["Finding Free Food","campusfood.png","campusfood3.png","campusfood2.png","Campus Food",B.CY,B.Dl,"The login screen of the app","An example of a post on the app","See it on the Play Store","https://play.google.com/store/apps/details?id=com.certainly_apps.campus_food",4293357950,"From a small Twitter bot to a mobile application functioning on over 800 campuses in the United States, Campus Food has come a long way. What started as a simple idea to learn Python turned into a mission to help hungry students find free food and reduce food waste."]),t.b)
B.KK=new A.aQ("Eyeglasses should be a form of expression. What if instead of selecting from a limited set of cookie-cutter eyewear, you could have fully customized glasses? What if you could do this all from the comfort of your home? This was the idea behind an entrepreneurial project I worked on in my sophomore year of college.\n\nWorking with a small team in a makerspace, we designed a way to quickly capture eye measurements from a standard smartphone selfie camera. With this data, we could manipulate standard eyeglass forms to guarantee superior fit.\n\nOur ability to make custom glasses was enabled by using wood laminate and polycarbonate blanks cut out on an industrial laser cutter. This lets us gain full control of each measurement and curve of the frames. From there, my team envisioned a system where a user could fully design their own styles. For customization, the sky was the limit!",null,B.q,null)
B.Cs=A.a(s([B.KK]),t.n)
B.Kp=new A.aQ("This project got accepted into the RIT Summer Start incubator, my college\u2019s exclusive student incubator. With the funding they provided my team, we spent the summer conducting market research and advancing our concept. Classes focused around competition analysis, prototype validation, analyzing growth financials, and developing our pitching skills.\n\nIn the 13 weeks of the program Form Eyewear transformed from a simple way to customize eyeglass styles into a form-fitting program for customers who want a truly custom fit. Summer Start was a great experience to rapidly iterate on an idea with other entrepreneurs in a similar stage of development.",null,B.q,null)
B.Di=A.a(s([B.Kp]),t.n)
B.Cb=A.a(s(["Eyeglass Buying","form.png","fe3.png","fe2.png","Form Eyewear",B.Cs,B.Di,"The features of a pair of Form Eyewear sunglasses","Custom defined measurements","","",4285807152,"Imagine being able to design your own eyeglasses that perfectly fit your unique facial measurements, all from the comfort of your own home. This was the vision behind an innovative project called Form Eyewear, which transformed from a simple software tool into a fully customizable and form-fitting eyeglass buying experience for customers."]),t.b)
B.Kn=new A.aQ("A common problem I believe in is that technology is advancing far faster than our education system. Teachers, though experienced in many fields, are continuously asked to prepare emerging technology lessons without the support of the appropriate budget or time to learn themselves. For this reason, many modern engineering subjects are simply unable to be taught outside of a specialized environment. Though certainly not the norm, I was fortunate enough to attend a high school that offered specialized engineering classes. I still see it as a critical part of my learning experience and I want to break down barriers in order to make this opportunity available to more students.\n\nIf we brought down the cost of materials and improved the learning curve for the instructor, most of the barriers to entry for this critical education could be eliminated. Currently, for $60 an instructor can demo basic electronics and circuitry lessons to a class. This is the cost of one kit, a kit that only one individual can interact with at a time. For this project, I wanted to offer that same learning experience to an entire class at the same time, all while not increasing the cost.\n\nMy solution to this problem: paper, easily the most common classroom material there is.",null,B.q,null)
B.Co=A.a(s([B.Kn]),t.n)
B.Kq=new A.aQ("Paper Bread is an interactive online circuit maker where teachers could build their own, or download pre-built lesson plans for circuits. The circuit components listed in the lesson plans were real prototyping components such as breadboards, LEDs, SMD resistors, and various sensors. Most lesson plans have a cost per student of $2 ($60 for a class of 30 \ud83c\udf89) and can include links to purchase the components wholesale.\n\nLesson plans are printed and placed on top of each breadboard. The students are then instructed to punch each component through the paper and into the breadboard to complete the circuit. This design resembles the functions of the Lite-Brite toy.\n\nI tested this project at Imagine RIT and two Maker Faires, helping people from 8 to 80 years old make their first circuit. The look of excitement when they lit up their first LED or connected their first sensor felt as though they had just performed magic. In under 10 minutes, participants went from a printed sheet of paper on a plastic box to controlling electricity using real electronics.\n\nI am currently working on making a more stable version of this project and testing it in more classrooms. If you are interested in testing it out or finding out more, please feel free to reach out to me: McCossum@gmail.com. Together, we can make engineering education more accessible and exciting for students of all ages.",null,B.q,null)
B.By=A.a(s([B.Kq]),t.n)
B.C8=A.a(s(["Learning Electronics","paperbread.png","pb2.png","pb3.png","Paper Breadboarding",B.Co,B.By,"A Parer Bread kit cut out","A young student using Paper Bread","","",4286207800,"The making of an interactive online circuit maker that uses real prototyping components and simple paper to teach basic electronics lessons to any class. All while making hands-on learning more affordable."]),t.b)
B.Ka=new A.aQ("As an entrepreneur, I firmly believe that finding new applications for existing products is just as important as creating new products. Not only does it provide new value to an existing product, but it also greatly reduces the expensive development time. In fact, this is the approach I took with many of the applications in my portfolio.\n\nIt all started with Campus Food, an application my team and I developed to help hungry college students locate free food. To make this possible, we created a system to aggregate and display live, crowdsourced geolocation data. However, after running the service for a few months, a local food bank reached out to me thinking they were the app's intended audience. This taught me a valuable lesson in better branding the application, as there was nothing preventing them from being the customer of a food geolocation aggregation service. Therefore, we quickly threw a new skin on the application and rebranded that fork as Community Food for them.\n\nCampus Food took months to create, but the transition to Community Food only took a few weeks. At this point, we realized that it was easier to develop new applications for new markets instead of trying to add increasingly complex features to obtain a niche market in our current app. Consequently, my team split into one group working on potential new markets, while the other group maintained and marketed the already developed apps. This is when we created Upkeep Alert.",null,B.q,null)
B.B5=A.a(s([B.Ka]),t.n)
B.Kw=new A.aQ("The idea for Upkeep Alert came to me while on my way to a college exam. I needed to quickly use the restroom, but the sink was stuck and overflowing, wasting a ton of water and damaging the area. I did nothing about this, as my exam felt more important to me than taking time to call maintenance. Due to not having a system to quickly send urgent maintenance requests, the expenses from these events piled up. This inspired the idea for Upkeep Alert, which simplifies the maintenance reporting process.\n\nPreviously, the process for maintenance reporting was tedious and time-consuming. It required observing a maintenance issue, finding a computer, logging into an online portal, and trying to describe an issue you are no longer even keeping an eye on. However, by using the same system as the other applications, all someone would have to do moving forward is take a picture on their phone and provide an optional description. The geolocation data would be sent right to maintenance. The multi-step process was reduced to just two quick actions.\n\nDue to the criticality of the data being captured by the app, my team created a unique strategy of rolling out changes. We would test new features in Campus Food, an app that if it failed, only a few college students may miss out on free food. From there we tested them in a more critical application, Community Food. If all went well, we would finally roll out the changes to Upkeep Alert, keeping our potential enterprise customers on the most stable and tested application.\n\nOur ultimate goal is to integrate Upkeep Alert's simple reporting system into other commonly used maintenance management applications. Even without that, I've learned that finding new applications for existing products can be just as valuable as creating new products. I'm excited to continue exploring this mindset in my future endeavors.",null,B.q,null)
B.Dd=A.a(s([B.Kw]),t.n)
B.Cv=A.a(s(["Maintenance Requests","ua3.png","upkeepalert.png","ua2.png","Upkeep Alert",B.B5,B.Dd,"Marking a maintenance issue on the app","Providing more information on a maintenance issue","","",4279989187,"Discovering new applications for existing products can be just as important as creating new products. Upkeep Alert is one of those products, it adds new value to an existing system and helps us keep our world clean. I share my journey of transforming one app into many and how it changed the way my team approached product development."]),t.b)
B.Kv=new A.aQ("It is my strong belief that some people do not deserve the fame the media gives them. News organizations fixate over the actions of evil individuals instead of the life stories of those affected. It is all too common that those who commit crimes are more remembered than the victims. Committing heinous acts should not be a means to fame, publicity, or anything positive.\n\nI grew up in the digital age. From the time I entered high school, I started receiving my news not just from mainstream cable providers but from then-smaller indie productions. These shows were unique to me because of its bootstrap production setup and their ability to challenge the cookie-cutter model of broadcast news networks. One show implemented a policy of not displaying or even naming individuals accused of monstrous acts. This was the first time I had seen a news organization have a policy like this and it greatly appealed to me.\n\nTaking the idea from the show, I wanted to attempt to bring this approach to the rest of the internet. What came of this was NoFame, an optional Chrome plugin to remove the names of monsters from web pages. No longer would users have to constantly be surrounded by the names and life stories of school shooters, mass murderers, and other vile people; instead, it would replace their name with what they truly are, \u201ca monster.\u201d",null,B.q,null)
B.Cp=A.a(s([B.Kv]),t.n)
B.KI=new A.aQ("Though this plugin will never be able to replace all mentions of monsters, I do try to keep up with lists supplied from well-reviewed Wikipedia lists. Admittedly, there are also a number of problems with the plugin being unable to appropriately remove common names and pictures of these people. I recognize these current shortcomings and do want to continue to improve the tool. If you believe you have a well-reviewed Wikipedia page that should be included in our list, please add it with the form here: https://bit.ly/2EHdsH6. With your help, we can make evil a fameless pursuit.\n\nFor more information as well as access to the plugin please visit this link or search \u201cNoFame\u201d in the Chrome WebStore.",null,B.q,null)
B.Dc=A.a(s([B.KI]),t.n)
B.Cj=A.a(s(["Infamy","nofame.png","nofame.png","nofame.png","NoFame",B.Cp,B.Dc,"NoFame logo","NoFame logo","See it on the Chrome Web Store","https://chrome.google.com/webstore/detail/nofame/fjjggbeocpjmkmfhlbggbbfehnkdcblp?hl=en-US",4284900966,'Are we giving fame to the wrong people? The media tends to focus on the actions of evil individuals, rather than the stories of those affected. I wanted to take a stand by creating a Chrome plugin which removes the names of horrible individuals from web pages and replaces them with the appropriate label: "a monster".']),t.b)
B.Kd=new A.aQ('Innovation is a crucial aspect of modern-day entrepreneurship. It is the driving force behind the creation of new products and services that solve problems and enhance our lives. However, innovation can also be limited by our biases and perceptions of who our target market should be. This was the subject of a discussion during my second year of college, when I was leading the Innovator\'s Hour research organization through the Albert J. Simone Center for Innovation and Entrepreneurship.\n\nWe realized that most of the entrepreneurial ideas coming from the club were targeted towards what we then called the "iPhone Demographic." This largely upper-middle-class demographic usually consists of white, predominantly male, able-bodied individuals. While there are many reasons for selecting this demographic when doing case studies for new products and services, an immense portion of the population remains ignored.\n\nIn order to address this issue, our organization decided to reach out to diversity, inclusion, and belonging groups on the RIT campus. We partnered with Grey Matter, a hot-button discussion group, along with the Center for Diversity and RIT\'s President\'s office to plan a weekend-long event named "Design for Diversity."',null,B.q,null)
B.D0=A.a(s([B.Kd]),t.n)
B.K8=new A.aQ('The goal of Design for Diversity was to challenge students to design a product or service benefiting those in underrepresented groups. Teams of students were assigned pre-written user stories focusing on the lives of immigrants, specially-abled individuals, and various marginalized populations. From there, the teams examined what popular modern products were not serving these demographics and worked to identify why. The list the teams created was even larger than we expected.\n\nThe teams were then given the next 24 hours to reimagine popular products to better address the needs of their given user story. Innovator\'s Hour recruited a number of faculty moderators to advise the teams, making sure topics stayed respectful, appropriate, and unbiased toward negative stereotypes or assumptions. Many of the mentors even included individuals whose life experiences paralleled those of the user stories, gaining real market research in the process.\n\nAt the end of the weekend, the teams regrouped to present their work. Though none of these ideas ever came to market, the goal of this event was still achieved. It was never our intention to sell a new product or service from this weekend but instead, we wanted students thinking outside the illegitimate box of the perception of a "normal" end-user. We hope this activity inspires more diverse work in the RIT entrepreneurship community moving forward.\n\nThis event highlights the importance of considering diverse perspectives when it comes to innovation. As entrepreneurs, it is essential that we challenge our biases and assumptions in order to create products and services that benefit a wide range of individuals. By doing so, we not only expand our potential customer base but also create a more inclusive society where everyone has access to products and services that meet their needs.',null,B.q,null)
B.C2=A.a(s([B.K8]),t.n)
B.Ck=A.a(s(["Disability Design Thinking","desfordiv.png","ih2.png","ih3.png","Design For Diversity",B.D0,B.C2,"Students brainstorming","Students presenting their final project","","",4291110187,'When it comes to innovation, our biases and perceptions can limit our potential for success. My team recognized this and organized a weekend-long event called "Design for Diversity" to challenge students to design products and services benefiting underrepresented groups. By considering diverse perspectives, entrepreneurs can create a more inclusive society where everyone has access to products and services that meet their needs.']),t.b)
B.Ku=new A.aQ("Coffee grounds and rubber balloons. These are everyday items that most people may have lying around their house. They are fairly cheap and can help put together a good party but what if they could also work as a decent universal grabber for those without full dexterity?\n\nBy filling a common latex balloon with coffee grounds, or another fine ground yet unevenly sized material, and applying a vacuum, it will tightly form around whatever object it is pressed against. The granular material will go from acting more like a liquid to acting as a rigid solid. Along with this, the latex balloon will create a fair bit of friction, allowing for it to grab even obtuse angles.\n\nThis idea is already used in a few industrial applications for picking up and placing objects of non-standard geometry. Experimenting with this idea in college I wanted to see if I could create one of these devices to pick up things in my dormitory and how small I could make it. After playing around with it for a while I realized there may be potential to help people with low dexterity pick up objects. Using a balloon was a lot easier than using one of those claw arms used by people who cannot bend over and it can pick up a wider range of objects. Creating a grabbing-wand would certainly be one way to take this project, but I also found the idea of making a palm-sized device quite interesting. Having this device in the palm of your hand would allow people with limited or no mobility in their hands to still pick up small objects with ease. The best part was that the materials were mostly household items already and the cost would be fairly low.",null,B.q,null)
B.Cq=A.a(s([B.Ku]),t.n)
B.KB=new A.aQ("Areas where this design falls short are, first and foremost, around the fact that this device does not look like a traditional hand. There is an immense amount of work trying to create prosthetics that look similar to a human hand. This is completely understandable, as there is a strong stigma around having an artificial part of your body. This design simply does not take this into account at this time. Also, the vacuum needed in this design is quite powerful, though there are some improvements that could greatly scale this down in a closed system. Along with this, the current model is quite bulky and complex. It puts functionality and versatility above aesthetics and simplicity. There are also concerns with the current model\u2019s durability over time. Luckily, the parts most likely to need replacement are some of the cheapest currently.\n\nI would greatly enjoy being able to test these designs further in real-world situations. There are plenty of areas for improvement but the idea still stands- there must be a cost-effective way to provide versatile prosthetics to those in need.",null,B.q,null)
B.B8=A.a(s([B.KB]),t.n)
B.C1=A.a(s(["Low-Mobility Dexterity","hand.png","joe2.png","joe3.png","Joe Universal Grip",B.Cq,B.B8,"Coffee grounds acting solid when compacted","Sketch of internal components","","",4290492856,"A device made from a latex balloon filled with coffee grounds may be able to help people with low dexterity. This cost-effective solution can be used to pick up a wide range of objects by using basic materials in new ways."]),t.b)
B.KN=new A.aQ("As a Pacific Northwest native, I grew up surrounded by bikes and bike racks. I remember as a child jumping between the loops of the wavy, curbside racks, feeling pretty cool. However, as I grew older, the racks became more of a nuisance than anything else. They narrowed packed sidewalks and collected politically-charged stickers, yet they still served a great public use.\n\nIt wasn't until I took a high school Engineering Design class that I realized the potential for engineering and design-thinking to solve real-world problems. Over the course of a year, my team, consisting of my best friend, a random classmate, and myself, chose to tackle the mild nuisance of bike racks.\n\nOur goal was to find a solution that would allow us to have as many bike racks as desired while removing them from cluttering pathways when not in use. We came up with the idea of folding bike racks, which would allow them to be placed flush with the pathway when not in use. However, this created a host of new problems, such as safely locking into place when in use, not tripping people, and leaving behind holes when in use.",null,B.q,null)
B.C5=A.a(s([B.KN]),t.n)
B.Kj=new A.aQ("To address these challenges and quickly demonstrate solutions, we learned basic AutoCAD. This allowed us to design solutions for vertically sliding racks or smaller post-style racks. This project was my first experience with a design-thinking approach, and I learned a lot about iterative solutioning in engineering.\n\nIn the end, our project was a success. We presented our designs to the class, and our teacher was impressed with our creativity and attention to detail. It was an incredible feeling to see the potential impact that our work could have on our community. This experience solidified my passion for engineering and problem-solving and set me on a path to pursue a career in the field.",null,B.q,null)
B.Ct=A.a(s([B.Kj]),t.n)
B.C3=A.a(s(["Bike Racks","rack.png","rack3.png","rack2.png","Hidden Bike Racks",B.C5,B.Ct,"Early prototype of the folding bike rack","Render of the folding bike rack\n(Sliding version in round picture above)","","",4282874563,"Moving bike racks out of the way while keeping all of their functionality. This was a problem my team came up with and tackled for a high school engineering class. Using design-thinking to remove a minor nuisance and create a new opportunity."]),t.b)
B.Kk=new A.aQ("As we go about our daily lives, we often take for granted our ability to hear and react to sounds around us. However, for those who are part of the Deaf and Hard of Hearing community, simple sounds can go unnoticed, leaving them vulnerable in potentially dangerous situations. This is where Wavio comes in, a startup focused on developing intelligent sound recognition technology to help remove barriers faced by the Deaf and Hard of Hearing community.\n\nImagine cooking mac and cheese while babysitting and suddenly hearing a cry for help. For someone with normal hearing, this might be a common occurrence, but for someone who is Hard of Hearing or Deaf, hearing a cry for help can be a challenge. Similarly, imagine being in a friend's house for the weekend and not being able to hear the doorbell or fire alarm. These situations can be incredibly dangerous, and time is of the essence when it comes to responding to them.\n\nThe Wavio device was designed to be a fully integrated notification platform that could be easily deployed through plug-and-play sound recognition technology. The device would listen for critical sounds and then notify the user on their smartphone, giving them the information they need to take action quickly. With the help of proprietary audio signal processing algorithms, the Wavio team was able to create a unique user experience that would help remove barriers and take advantage of emerging technology solutions.\n\nWhat made the Wavio team unique was their deep understanding of the challenges faced by the Deaf and Hard of Hearing community. Led by members who had experienced many of these difficulties firsthand, the team was highly motivated to create a product that could truly make a difference. As a result, they were able to bring together a team of engineers and designers to develop a product from conceptual designs through market validation and manufacturing negotiations.",null,B.q,null)
B.D8=A.a(s([B.Kk]),t.n)
B.Kt=new A.aQ("Working with the Wavio team gave me a valuable perspective on designing products with the needs of specific customer segments in mind. I learned about PCB layout, design for manufacturability, and most importantly, gained insights from a community that I was not previously familiar with. The experience helped me understand the importance of developing products that are accessible to everyone, regardless of their abilities.\n\nThe Wavio device is a great example of how technology can be used to help remove barriers faced by those who are Hard of Hearing or Deaf. By developing a product that is easy to use and accessible to everyone, the Wavio team has helped create a more inclusive world. Their innovative approach to sound recognition technology has the potential to revolutionize the way we interact with our environment, making it safer and more accessible for everyone.",null,B.q,null)
B.Cm=A.a(s([B.Kt]),t.n)
B.Dn=A.a(s(["Hearing","wavio1.png","wavio3.png","wavio2.png","Wavio",B.D8,B.Cm,"Wavio device concepts","A Wavio prototype plugged into a wall","See how the project advanced: see-sound.com","https://www.see-sound.com/",4280655359,"Wavio is a startup that has developed an intelligent sound recognition technology that removes critical barriers faced by the Deaf and Hard of Hearing community. With their device plugged into the wall, users can be notified on their smartphone of critical sounds, enabling them to take action quickly, making the world a safer and more inclusive place for everyone."]),t.b)
B.KP=new A.aQ("Have you ever had the frustrating experience of wanting to go out and eat with someone but you just can\u2019t agree as to where? For people who want to quickly and collaboratively choose where to eat, I created Munch Match.\n\nMunch Match is a unique and innovative app that allows users to quickly and collaboratively decide on where to eat. Think of it as Tinder, but for restaurants. With Munch Match, you can swipe through a list of nearby eateries in the comfort of your own privacy. You can choose as many places as you like without having to explain your choices one by one. Meanwhile, your companions can do the same. The app alerts you and your party as soon as there are several matches, presenting a short, agreed-upon list of vetted restaurants instead of a lengthy and controversial list of food choices.",null,B.q,null)
B.C0=A.a(s([B.KP]),t.n)
B.KD=new A.aQ("The app was developed using Flutter/Dart, which allows for a seamless and intuitive user experience. It also utilizes the Yelp API and several other support libraries for Flutter, providing users with important filtering information such as distance, rating, and price.\n\nMunch Match is perfect for group outings, dates, or even solo diners who want to quickly decide on a restaurant without the hassle of endless discussions. It's available for download on both iOS and Android platforms, so you can easily find the perfect place to eat no matter where you are.\n\nSo, if you're tired of the \"where to eat\" dilemma, Munch Match is the solution you've been searching for. Try it out today and experience a hassle-free and enjoyable dining experience.",null,B.q,null)
B.Ba=A.a(s([B.KD]),t.n)
B.Cl=A.a(s(["Picking Where to Eat","mmicon.png","rm.png","rm3.png","Munch Match",B.C0,B.Ba,"App screenshot","Example of a card within the app","See it on the Play Store","https://play.google.com/store/apps/details?id=com.electricblueideas.munch_match",4283020262,"Munch Match is an innovative app that simplifies the process of choosing a restaurant by allowing users to swipe through a list of nearby and notifying users when there are multiple matches. Munch Match is perfect for group outings, dates, or adventurous diners who want to avoid the hassle of lengthy and controversial food choice discussions."]),t.b)
B.K6=new A.aQ("What if the future of power generation was wearable?\n\nIn my final year of college, I had the privilege of taking the Functional Printing special topics class in the AMPrint Center. This was conducted in the NY State Center for Advanced Technology funded Center for Additive Manufacturing and Multifunctional Printing. All the long names made the class feel very official.\n\nIn the class we studied an immense amount of printing styles, from Flexo to Gravure and Stereolithography to Fused Deposition Modeling. Throughout the entirety of college, no class made my head hurt more. It was incredible to see all the various solutions to printing and additive manufacturing processes, but this class was not just for demonstrating existing methods. For our grade in the class we had to use a combination of the printing methods in a new way. This meant either creating a new end-product using the tools or combining the printing methods in a new way.\n\nMy team took on trying to create a Peltier tile on a flexible substrate. The main goal of the project was to create a printed, flexible Peltier device that could produce small amounts of current through the Seebeck effect when a temperature gradient was applied on either side. Peltier devices had, up to this point, traditionally been made of rigid ceramic in order to withstand their temperature gradients. This increases their durability but prevents them from properly conforming to irregular surface areas. \n\nThe potential for a flexible Peltier device could open the door to possibilities of thermal power generation in wearable technology. With further research, it is feasible that fabric-like material could generate small amounts of energy with the temperature gradient between the body and the ambient room temperature. This would open the door for the continuous recharging of wearable tech. Above all this, the flexible and patterned method for creating these devices could allow for roll-to-roll processing of these devices, allowing for variable sizes and an overall reduction in manufacturing cost.",null,B.q,null)
B.B6=A.a(s([B.K6]),t.n)
B.KE=new A.aQ("All major parts of the Peltier device have been commonly printed for other drives. This includes flexible copper, printed solder, and both P and N type semiconductors. By printing flexible copper traces into a flexible yet heat resistant substrate such as Kapton and depositing P and N type printable semiconductors like PEDOT:PSS, a flexible Peltier device is theoretically possible.\n\nA basic Peltier tile functions with an insulative air gap between components, allowing for an increased temperature gradient. With the appropriate printing methods, we can replace this with a flexible silicone insulator to further enhance the effects. This could also allow for smaller material deposition sizes by using the ceramic to place the semiconductors more precisely. By having everything more compact, the device would be much more efficient at generating current.\n\nDuring the course of the semester, our tested printed Peltier device did not show conclusive results. This could have been due to the limited number of semiconductor junctions or large impurities in our printing processes. We also did not have access to the printable semiconductor material we had first envisioned with the design. More research would have to be done in order to find a more efficient process for creating this device.",null,B.q,null)
B.Dk=A.a(s([B.KE]),t.n)
B.CX=A.a(s(["3D Printed Power Generation","pt1.png","pt3.png","pt2.png","Flexible 3D Printed Peltier Tiles",B.B6,B.Dk,"Assembling layers of printed components","Testing of an early prototype","","",4294609154,"What if you could generate electricity simply by wearing a piece of clothing? Using additive manufacturing we may be able to create a flexible Peltier device that could power wearable technology, leading to a future of sustainable energy generation."]),t.b)
B.ii=new A.l(!0,B.k,null,null,null,null,24,B.aq,null,0.25,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null)
B.Kx=new A.aQ("Current Concepts",null,B.q,B.ii)
B.b5=new A.l(!0,B.k,null,null,null,null,18,B.aq,null,0.25,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null)
B.Kl=new A.aQ("\n\nBackground",null,B.q,B.b5)
B.K7=new A.aQ("\n\nThe recent rise in Non Fungible Tokens (NFTs) has shown a modern resurgence in the classic collectable market. NFTs expand on the established fungible token trading markets such as Ethereum and Bitcoin by adding a unique characteristic to each item.\n\nMillions of NFTs have been created and traded in the first few months of 2020. One of the most notable NFTs is CryptoPunks, a set of pixelated headshots creating a total trade volume of $259.03M. This set of tradable tokens is capped at 10,000 total unique images. Each one allows for a subjective value to be assigned to them in the eyes of the market. This subjective value is the driving force behind the rise of NFTs and many cryptocurrencies. These assets, untied to any physical value, are purely distilled to their tradable value.",null,B.q,null)
B.K3=new A.aQ("\n\nThe Finite",null,B.q,B.b5)
B.Kh=new A.aQ("\n\nThe CryptoPunks set is innately finite. This sets a scarcity demand that creates economic stability for Cryptopunks and other similar NFTS, not unlike how the gold standard created stability for the U.S. dollar. Due to the limited set of CryptoPunks some traders aim on collecting like sets, thus inflating the value of their investment for future trades. At the same time the scarcity has made CryptoPunks an almost untouchable market for the layman. The average price for a CryptoPunk token is absorbently high due to the notoriety and combined scarcity. This is an issue that will,  at some point, limit all sought-after NFT sets.",null,B.q,null)
B.KC=new A.aQ("\n\nThe Expandable",null,B.q,B.b5)
B.Km=new A.aQ("\n\nAnother implementation of the limited nature of NFT and cryptocurrency sets is the growth-over-time model. This is most notably seen in the Bitcoin market. Bitcoin acts in an inflationary way, as community members can mine new Bitcoins. Token mining allows the set to scale over time, enabling new members to jump into the marketplace before all 21 million Bitcoins are released. All Bitcoins will be mined in roughly 120 years. Part of the policy\u2019s aim is to balance scarcity with new demand, in order to curb rapid fluctuations and monopolies.",null,B.q,null)
B.KG=new A.aQ("\n\nThe Infinite",null,B.q,B.b5)
B.Ke=new A.aQ("\n\nMost current mainstream cryptocurrencies have a planned maximum set. Very few, such as $NEO, are potentially infinite. This can be achieved by never setting a limit to new tokens being mined. As long as the ability to mine tokens exists, community members will assist the network\u2019s function. This sets up the hypothesis that once all tokens from a set are created, the market will enter a highly unpredictable state.\n\nNo current mainstream currency is both able to maintain a finite set of whole tokens and infinitely divisible. For Bitcoin specifically, the smallest possible unit is 0.00000001 BTC, called a \u201cSatoshi.\u201d At time of writing, one Satoshi is roughly 0.02 cents. By being unable to divide further, this creates a wealth floor, removing the fair representation of goods under that amount. This will only get worse as the value increases, which possibly prevents some people from being able to partake in the crypto revolution.",null,B.q,null)
B.KM=new A.aQ("\n\nThe Live",null,B.q,B.b5)
B.K2=new A.aQ("\n\nNTFs have also been created to reflect ownership of \u201clive\u201d or real world goods. A prominent example of this phenomenon is Nike securing a patent to list shoe ownership in token form. This public ownership ledger could help them ensure the authenticity of sold/traded shoes. While an excellent idea, this fundamentally sets these tokens apart from other NFTs. Tying NFTs to live assets from shoe ownership to concert tickets puts a fundamental floor on the value of the NFT. This floor is seen as the value of the item before being posted to an NFT ledger. This value may change due to transactional costs such as shipping, material scarcity, labor, or other hastles. Not only does this set a potential value floor, but it creates a value ceiling as well. The maximum value of any live NFT can be seen as the maximum cost to secure and insure the longevity of the asset. If the live asset is destroyed yet traded, it is no different from other non-live assets. For these reasons, live NFT trading is fundamentally flawed as an economic model and does not utilize the full potential of a digital economy.",null,B.q,null)
B.Df=A.a(s([B.Kx,B.Kl,B.K7,B.K3,B.Kh,B.KC,B.Km,B.KG,B.Ke,B.KM,B.K2]),t.n)
B.KF=new A.aQ("Novel Concepts",null,B.q,B.ii)
B.K9=new A.aQ("\n\nA Finite Infinity",null,B.q,B.b5)
B.KJ=new A.aQ("\n\nCreating an asset, or set, which has a known total value but is infinitely divisible, was infeasible until the digital era. Most physical currencies only have about 20 value units consisting of cash and coins, allowing for simple, countable transactions among a general population. With the assistance of computers, we can ignore the need for easily identifiable units and focus on the agreed value of the transaction as a unit in itself. This method is how electronic (cashless) payments have been working for years. Even they, however, have a minimum divisible unit often set by a physical payment system.\n\nOne way to conceptualize this is to reconceptualise this new economic model as an economy based around a single dollar. If you take that dollar and divide it in half, you now have 2 tokens adding up to the total original value. To take this further, this imaginary dollar can be repeatedly divided into infinite parts and reassembled without adding or losing any parts. Most importantly to this is that there will never be any more than one dollar. It is up to the community to assign value to the set and decide how far they need to divide the parts.",null,B.q,null)
B.Ki=new A.aQ("\n\nThe New Infinite",null,B.q,B.b5)
B.Kz=new A.aQ("\n\nThere are more numbers between 0 and 1 than there are total integers. Both sets are infinite but creating a currency with growth built in will act in an inflationary manner over time. Creating a currency with a set known maximum yet maintaining infinite growth could provide more long term stability while still enabling it to serve any population. This is unlike any currency in existence.\n\nAny finite asset will eventually be lost to entropy. This is mainly due to people losing access to their assets or passing on without relinquishing access to the held tokens. It is estimated that 25-30% of Bitcoin is currently inaccessible for these reasons. The process of losing access to tokens will increase the value of the remaining set to a highly restrictive amount due to scarcity. Using an infinite currency is the only way to avoid this setback.\n\nCreating a currency that is infinitely divisible allows for all assets, no matter how low in value, to be traded. This principle also keeps deflationary scarcity tactics such as money hoarding from affecting the currencies value on a large scale. With this economic tactic a single currency can continue to represent a population as a whole even with an equally infinite population or growing wealth inequality.",null,B.q,null)
B.Ks=new A.aQ("\n\nThe New Finite",null,B.q,B.b5)
B.KH=new A.aQ("\n\nEven with an infinite set, there are still methods to create demand and scarcity. Imagine a fractal. As it is subdivided it still maintains its original form (see images). If you take this image and apply a linear gradient over it, the form and repeatability remain the same but now each pixel or region has a unique color value. This allows the holder of that subset region to know exactly which region they hold but without innately changing any aspect of the token; size, intrinsic value, or otherwise. This combines the fungible nature of cryptocurrencies with the uniqueness of NFTs.\n\nA currency with these features would allow the community to trade tokens with value assigned from either the fungible fraction value or the unique position attribute. By combining both these qualities the possibilities of how the community will interact with and assign value are immense. We can further set assets to the currency to enable more controlled and interesting attributes.",null,B.q,null)
B.Kg=new A.aQ("\n\nDeconstruction and Reconstruction",null,B.q,B.b5)
B.Ky=new A.aQ("\n\nAs the assets are infinitely divisible they must also be able to be recombined in order to curb inflationary behaviours. A few extra rules can be set in place to disincentivize divisions while still allowing for their existence.\n\nIf any token can be broken down but only \u201cadjacent\u201d tokens - those with unique values sequential to each other - can be reassembled into larger tokens, it would encourage the community to assess value off of both the fungible and non-fungible aspects. If community members are looking to grow their sets, they have to look at transactions based not only on the perceived value of the tokens but the unique value of the token\u2019s adjacentcy to the tokens they already hold.\n\nThis may enable many unique features to the currency\u2019s community, such as groups looking to only trade for tokens in specific regions of the set, thus looking to increase their chances of being able to build back their divided tokens. This allows for the idea of currency subsets within the single currency. These communities can grow to represent a subset of the currency\u2019s range without changing any of the initial aspects and functionality of the currency. Just like a fractal, the initial principles and design are reflected in any subset.\n\nThere is a real need to encourage the use of larger tokens as well. Many smaller tokens will inevitably take more energy to register and reconcile transactions with than one large token. By charging a small transaction fee on the per-token basis, the system can largely incentivise the use of whole tokens.",null,B.q,null)
B.KA=new A.aQ("\n\n\nConclusion",null,B.q,B.ii)
B.Kb=new A.aQ("\n\nCreating an economy around an infinitely divisible and non-growing set enables many unique features we cannot achieve with any current economic systems. An infinite currency will enable its utility to expand far into the future, adapt to a population of any size, and set a trade value to even the smallest of items.\n\nThese tokens combine the best attributes of modern cryptocurrency trading with the unique collectibility of NFTs.\n\nBy creating a method and incentive to recombine held currency into larger assets, the currency\u2019s integrity can be preserved. In addition, opportunities will be created to find various methods of assigning value.\n\nThere is no way of knowing how a currency like this will truly behave once created, but it is the best way to ensure the longevity of a system far beyond our current imagination.",null,B.q,null)
B.BJ=A.a(s([B.KF,B.K9,B.KJ,B.Ki,B.Kz,B.Ks,B.KH,B.Kg,B.Ky,B.KA,B.Kb]),t.n)
B.D9=A.a(s(["Cryptocurrency Economics","e.png","tri1.png","tri2.png","The Infinite Economy",B.Df,B.BJ,"Representation of\nhow the system is maintained\nwhile infinitely divided","Representation of\nhow unique attributes are preserved\nin an infinite set","Clap on Medium","https://mccossum.medium.com/the-infinite-economy-2ba585b61ddb",4289831540,"What if there was a new economic model that enabled a currency with infinite reach while maintaining a set quantity, providing long-term stability and avoiding inflationary behaviors? With the ability to trade all assets, no matter how low in value, and using a unique combination of fungible and non-fungible attributes, this new currency model has the potential to revolutionize the way we think about money."]),t.b)
B.Kc=new A.aQ("Cooking should be simple. Most recipes can be simplified down to three things; Ingredients, Temperature, and Time. This is in stark contrast to how recipes are presented online. Many hide behind long stories and intrusive ads. Even after all that I still found many recipes still hard to follow and keep track of my place in.\n\nI started working with a team of good friends to investigate methods of creating a great user experience while following new recipes. We worked on hardware, software, and design to tackle this initiative.",null,B.q,null)
B.B2=A.a(s([B.Kc]),t.n)
B.K4=new A.aQ("Starting with the software, we used a robust recipe parser to extract only the most relevant information from online recipes. No stories, no obscure links, only what the user needed to know to make the recipe. Along with this, we designed our screens to focus on minimalism, only showing the user one measurement or instruction at a time. This guaranteed comprehension while maintaining an intuitive flow.\n\nAll of the software paired directly with our custom hardware. To seamlessly connect the digital space to the physical food our team designed a sleek, food-safe, scale. With the aid of this scale, users could navigate through a recipe without the need to know exact amounts. All they have to focus on is if they need to add more or less of each ingredient to the scale. This allowed recipes to auto-advance on the phone once each ingredient was correct. This intuitive pairing allowed room for a level of simplicity in recipes that was previously unheard of.\n\nAll this is wrapped up in a design language that spans across both software and hardware. The scale easily pairs with our kitchenware and bowls to automatically detect and calibrate the added weight. Our unique stamped logo guarantees grip and stability of app parts leading to fewer messes compared to other scales. Even if there is a mess, our scale is one of the few covered in dishwasher safe parts allowing for easy cleanup. This elegant design is reflected in the app as colors automatically change to match the user's kitchenware set and allow them to quickly jump into recipes with similar recipes to those made in the past.\n\nThis project is still in development by the team and does not have an official launch date as of this time. Our team is working diligently to ensure the success of the Banana Scale with over 10,000 recipes. Please allow notifications to hear about this project as it progresses.",null,B.q,null)
B.CF=A.a(s([B.K4]),t.n)
B.CI=A.a(s(["Preparing Food","rethinkrecipes.png","rr1.png","rr2.png","Banana Scale",B.B2,B.CF,"Starting a recipe","Minimalist instructions","","",4293878608,"Tired of sifting through long and intrusive online recipe stories just to find the information you need? Look no further than the Banana Scale, a revolutionary kitchen tool designed to simplify your cooking experience. With a focus on minimalism and intuitive design, this custom hardware and software pairing allows you to effortlessly navigate through recipes, leaving you with more time to focus on what really matters - the food."]),t.b)
B.KL=new A.aQ("Our interaction with the air around us is often taken for granted. Though the air we breathe is a constant shaping force in our lives we rarely think about how it changes with our environment. As we go throughout our day in different locations for both indoor and outdoor settings the composition of our air can vary greatly.\n\nAround 60 years ago Carbon Dioxide (CO2) concentrations were around 300 parts per million (ppm). Currently, in a natural environment, CO2 levels average about 415ppm. With this sudden change taking us 35% over the historical average and still growing, we are entering unprecedented territory.\n\nThis situation only gets more bleak when we look into unnatural environments. Office buildings and other crowded gathering spaces can have CO2 levels ranging from several hundred ppm to over 1000 ppm. This is still under common safety guidelines warning of levels of 5000ppm and above, but recent studies have shown there still may be reason for concern. At 1000ppm there is a 15% decrease in cognitive function going up to 50% at 1400ppm. If we care about our ability to think, either as an individual or a species, this issue needs to be addressed.\n\nOn a small scale, plants may be an option to curb high CO2 levels. It takes about 7-8 mature trees per person to exchange all the air we breathe. While trees are a vital part of our ecosystem they are certainly not the most efficient to manage CO2 levels, nor are they practical in an indoor setting. With the aid of selective breeding, we may be able to create super oxygenating plants and algae to curb indoor CO2 levels.",null,B.q,null)
B.CC=A.a(s([B.KL]),t.n)
B.Kf=new A.aQ("To test the hypothesis that I could breed better oxygenating species of algae and plants I started with 64 Fast Plants from the University of Wisconsin. These are a type of mustard seed with a total lifecycle of around 60 days. This would allow me to isolate leaves from mature plants and only germinate seeds from plants with the highest oxygen-producing levels per leaf mass. Over many generations, I expect to see a trend of higher oxygen-producing varieties.\n\nI have also started reproducing this experiment with Chlorella vulgaris, a type of algae, in a series of small bioreactors. This plans to be beneficial for the faster reproductive cycle leading to faster selection and evolution times. Also, it goes to say, the series of 12 green glowing bioreactors just look extremely cool. I could easily imagine these lining a sci-fi-looking spaceship in the future able to supply future generations with clean air and nutrients.\n\nThe experiment with Wisconsin Fast Plants is still ongoing and has not yet shown results, the same goes for the Chlorella vulgaris group. I do not expect to see significant changes till the 30th generation at earliest. I will work on posting updates as this unfolds so please sign up for notifications. This is a slow project but one that would leave behind a more efficient method for clean air in the future.",null,B.q,null)
B.C_=A.a(s([B.Kf]),t.n)
